func And(predicates ...predicate.SysDictionary) predicate.SysDictionary {
	return predicate.SysDictionary(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.SysDictionary) predicate.SysDictionary {
	return predicate.SysDictionary(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.SysDictionary) predicate.SysDictionary {
	return predicate.SysDictionary(func(s *sql.Selector) {
		p(s.Not())
	})
}
